 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (36,54,10.21,'Special Braised Beef Noodle Soup with Beef Brisket','Succulent juicy meat with noodles immersed in a bowl of flavourful soup – indeed a hearty meal on its own.');
 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (23,55,10.21,'Noodle Soup with Fried Pork Chop','Signature fried pork chop marinated with complex spices. A hearty yet wholesome twosome to slurp up with gusto.');
 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (37,56,10.02,'Fried Rice with Shrimps & Eggs','An extremely popular dish, the ingredients are pared down to simple rice, shrimps, eggs, and spring onions, creating a taste of familiar comfort.');
 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (21,57,10,'Noodle with Minced Pork in Bean Sauce','Handmade noodles cooked to a pleasantly springy consistency tossed with minced pork in bean sauce');
 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (49,58,13.4,'Double-Boiled Papaya & Snow Fungus with Rock Sugar','Excellent for the complexion and balancing of the inner soul, this is a healing dessert that is perfect for rounding up a simple lunch or dinner.');
 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (5,59,9.59,'Lemongrass Juice','A refreshing and fragrant drink that is subtly sweet and iced for a hot day.');
 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (5,60,23.32,'Mango Pudding',' Made with pure mango flesh, the select variety makes for a luscious pudding, with a heady aroma of freshly peeled mango.');
 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (39,61,11.2,'Laksa Noodles (Vegan)','Tuck into a comforting bowl of hearty, robust laksa made from scratch with blue ginger, yellow ginger, chillies and laksa leaves. Noodles, Straw Mushroom, Konnyaku prawn, Konnyaku ball, Tau pok and Beansprout');
 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (13,62,10.78,'Angelica Herbal Noodle w Cordyceps (Contain Milk)','Konnyaku Fishball, Soya Mutton, Tau Pok, Lettuce and Carrot served in a herbal broth with more than 10 Chinese herbs such as Angelica, Licorice and Wolfberry.');
 INSERT INTO MenuItems (res_id, food_id,price,name,description) VALUES (50,63,24,'Taiwanese Spicy Dry Handmade Noodles(Contain Milk)','Taiwanese Spicy Paste, Staw Mushroom, QQ tofu, Cucumber stripes, Carrot stripes and Parsley');
